import React, { useState } from 'react';

export const Register = () => {
  const [formData, setFormData] = useState({
    nombre: '',
    apellido: '',
    email: '',
    telefono: '',
    contraseña: '',
    confirmarContraseña: '',
  });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.status === 201) {
        // Usuario registrado correctamente
        setMessage('Usuario registrado correctamente');
        // Puedes redirigir al usuario a una página de inicio de sesión o realizar otra acción necesaria
      } else if (response.status === 400) {
        // Correo electrónico ya registrado
        setMessage('Correo electrónico ya registrado');
      } else {
        // Manejar otros casos de error
        setMessage('Hubo un error al registrar al usuario');
      }
    } catch (error) {
      console.error('Error al registrar usuario', error);
    }
  };

  return (
    <div>
      <br />
      <div className="row">
        <div className="col-md-4 col-sm-1"></div>
        <div className="col-md-4 col-sm-1 border border-1">
          <div style={{ padding: '30px' }}>
            <h2>Registrarse</h2>
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="nombre" className="form-label">
                  Nombre
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="nombre"
                  name="nombre"
                  value={formData.nombre}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="apellido" className="form-label">
                  Apellido
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="apellido"
                  name="apellido"
                  value={formData.apellido}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="email" className="form-label">
                  Email
                </label>
                <input
                  type="email"
                  className="form-control"
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="telefono" className="form-label">
                  Teléfono
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="telefono"
                  name="telefono"
                  value={formData.telefono}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="contraseña" className="form-label">
                  Contraseña
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="contraseña"
                  name="contraseña"
                  value={formData.contraseña}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="confirmarContraseña" className="form-label">
                  Confirmar contraseña
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="confirmarContraseña"
                  name="confirmarContraseña"
                  value={formData.confirmarContraseña}
                  onChange={handleChange}
                />
              </div>
              <div className="d-grid gap-2">
                <button
                  className="btn m-2 text-white"
                  style={{ backgroundColor: '#F5B041' }}
                  type="submit"
                >
                  Registrarme
                </button>
              </div>
            </form>
            {message && <p>{message}</p>}
          </div>
        </div>
        <div className="col-md-4 col-sm-1"></div>
      </div>
    </div>
  );
};

export default Register;
